   <section class="main-upper-text turtle row">
      <p>Pokut my chceš napsat ňejakou heskou správu jak se ti mojě znalosťi líbili, tak múžeš tadi. Nebo třeba jesly sy našel nějakou chibu, ale to se opovaš nebo dostaneš lopatou po hlavje. <span class="first-ps"> PS: je to ftip </span> <span class="second-ps"> PPS: neňí to ftip, lopatou dostaneš, ale y tak my tu chibu napyš</span></p>
   </section>

   <section class="write-me-message turtle row">
      <p>Samozřejmně ťi děkuju za kašdou přátelskou správu. Uďělá my to radost. Za kašdou nepřátelskou správu si uprdnu do kalhot a osobňě ťi je pošlu na tvojy adresu, protoše určiťe budu vjědět gde bidlíš. Vspomínáš na ty sušenki kerý si odklykával? Přesňě tak, vým gde bidlíš. Jynak pro legálňí účeli samozřejmně data ze sušenek použývám v souladu s nařýzeňím EU, GDPR a LGBTQRZ8S+.</p>
